import { NextResponse } from 'next/server'
const { ocrSpace } = require('ocr-space-api-wrapper');
/* Sends a GET request to PERENUAL to get the ID of the plant based on name */
/* Returns a response data which contains ID of the plant */

export async function POST(request: Request) {
  const param1 = 'data:image/png;base64,'
  try {
    // Using the OCR.space default free API key (max 10reqs in 10mins) + remote file
    const res1 = await ocrSpace(param1,  {apiKey: process.env.OCR_KEY });

    return NextResponse.json({data: res1.ParsedResults[0].ParsedText})
  } catch (error) {
    console.error(error);
  }
}